PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "videoservice_video" ("video_title" varchar(255) NOT NULL, "upload_date" datetime NOT NULL, "channel_id" varchar(255) NOT NULL REFERENCES "videoservice_channel" ("channel_id") DEFERRABLE INITIALLY DEFERRED, "video_id" varchar(255) NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "videoservice_channel" ("channel_id" varchar(255) NOT NULL PRIMARY KEY, "name" varchar(255) NULL, "created_at" datetime NOT NULL, "last_accessed" datetime NOT NULL);
COMMIT;
